import React from 'react'
import './RouteLink.css'

const RouteLink = ({text, onClickFunction, newRoute, linkClass}) => {
    return (
            <p
                className={linkClass}
                onClick={ () => onClickFunction(newRoute)}
            >{text}</p>
    )
}

export default RouteLink;
